import styled from "styled-components";

function Container({ bgColor }) {
  return <Box bgColor="#eee"></Box>;
}

const Box = styled.div`
  width: 500px;
  height: 300px;
  background-color: ${({ bgColor }) => bgColor};
`;

export default Container;
